webpackJsonp([0xa31548d07c3e],{2118:function(e,a){e.exports={pathContext:{docHtml:"<h1>braces <a href=\"https://www.npmjs.com/package/braces\"><img src=\"https://img.shields.io/npm/v/braces.svg?style=flat\" alt=\"NPM version\"></a> <a href=\"https://npmjs.org/package/braces\"><img src=\"https://img.shields.io/npm/dm/braces.svg?style=flat\" alt=\"NPM downloads\"></a> <a href=\"https://travis-ci.org/jonschlinkert/braces\"><img src=\"https://img.shields.io/travis/jonschlinkert/braces.svg?style=flat\" alt=\"Build Status\"></a></h1>\n<p>Fastest brace expansion for node.js, with the most complete support for the Bash 4.3 braces specification.</p>\n<h2>Install</h2>\n<p>Install with <a href=\"https://www.npmjs.com/\">npm</a>:</p>\n<pre><code class=\"language-sh\">$ npm install braces --save\n</code></pre>\n<h2>Features</h2>\n<ul>\n<li>Complete support for the braces part of the <a href=\"www.gnu.org/software/bash/\">Bash 4.3 Brace Expansion</a>. Braces passes <a href=\"#bash-4-3-support\">all of the relevant unit tests</a> from the spec.</li>\n<li>Expands comma-separated values: <code>a/{b,c}/d</code> => <code>['a/b/d', 'a/c/d']</code></li>\n<li>Expands alphabetical or numerical ranges: <code>{1..3}</code> => <code>['1', '2', '3']</code></li>\n<li><a href=\"#benchmarks\">Very fast</a></li>\n<li><a href=\"./patterns.html\">Special characters</a> can be used to generate interesting patterns.</li>\n</ul>\n<h2>Example usage</h2>\n<pre><code class=\"language-js\">var braces = require('braces');\n\nbraces('a/{x,y}/c{d}e')\n//=> ['a/x/cde', 'a/y/cde']\n\nbraces('a/b/c/{x,y}')\n//=> ['a/b/c/x', 'a/b/c/y']\n\nbraces('a/{x,{1..5},y}/c{d}e')\n//=> ['a/x/cde', 'a/1/cde', 'a/y/cde', 'a/2/cde', 'a/3/cde', 'a/4/cde', 'a/5/cde']\n</code></pre>\n<h3>Use case: fixtures</h3>\n<blockquote>\n<p>Use braces to generate test fixtures!</p>\n</blockquote>\n<p><strong>Example</strong></p>\n<pre><code class=\"language-js\">var braces = require('./');\nvar path = require('path');\nvar fs = require('fs');\n\nbraces('blah/{a..z}.js').forEach(function(fp) {\n  if (!fs.existsSync(path.dirname(fp))) {\n    fs.mkdirSync(path.dirname(fp));\n  }\n  fs.writeFileSync(fp, '');\n});\n</code></pre>\n<p>See the <a href=\"./test/test.js\">tests</a> for more examples and use cases (also see the <a href=\"./test/bash-mm-adjusted.js\">bash spec tests</a>);</p>\n<h3>Range expansion</h3>\n<p>Uses <a href=\"https://github.com/jonschlinkert/expand-range\">expand-range</a> for range expansion.</p>\n<pre><code class=\"language-js\">braces('a{1..3}b')\n//=> ['a1b', 'a2b', 'a3b']\n\nbraces('a{5..8}b')\n//=> ['a5b', 'a6b', 'a7b', 'a8b']\n\nbraces('a{00..05}b')\n//=> ['a00b', 'a01b', 'a02b', 'a03b', 'a04b', 'a05b']\n\nbraces('a{01..03}b')\n//=> ['a01b', 'a02b', 'a03b']\n\nbraces('a{000..005}b')\n//=> ['a000b', 'a001b', 'a002b', 'a003b', 'a004b', 'a005b']\n\nbraces('a{a..e}b')\n//=> ['aab', 'abb', 'acb', 'adb', 'aeb']\n\nbraces('a{A..E}b')\n//=> ['aAb', 'aBb', 'aCb', 'aDb', 'aEb']\n</code></pre>\n<p>Pass a function as the last argument to customize range expansions:</p>\n<pre><code class=\"language-js\">var range = braces('x{a..e}y', function (str, i) {\n  return String.fromCharCode(str) + i;\n});\n\nconsole.log(range);\n//=> ['xa0y', 'xb1y', 'xc2y', 'xd3y', 'xe4y']\n</code></pre>\n<p>See <a href=\"https://github.com/jonschlinkert/expand-range\">expand-range</a> for benchmarks, tests and the full list of range expansion features.</p>\n<h2>Options</h2>\n<h3>options.makeRe</h3>\n<p>Type: <code>Boolean</code></p>\n<p>Deafault: <code>false</code></p>\n<p>Return a regex-optimal string. If you're using braces to generate regex, this will result in dramatically faster performance.</p>\n<p><strong>Examples</strong></p>\n<p>With the default settings (<code>{makeRe: false}</code>):</p>\n<pre><code class=\"language-js\">braces('{1..5}');\n//=> ['1', '2', '3', '4', '5']\n</code></pre>\n<p>With <code>{makeRe: true}</code>:</p>\n<pre><code class=\"language-js\">braces('{1..5}', {makeRe: true});\n//=> ['[1-5]']\n\nbraces('{3..9..3}', {makeRe: true});\n//=> ['(3|6|9)']\n</code></pre>\n<h3>options.bash</h3>\n<p>Type: <code>Boolean</code></p>\n<p>Default: <code>false</code></p>\n<p>Enables complete support for the Bash specification. The downside is a 20-25% speed decrease.</p>\n<p><strong>Example</strong></p>\n<p>Using the default setting (<code>{bash: false}</code>):</p>\n<pre><code class=\"language-js\">braces('a{b}c');\n//=> ['abc']\n</code></pre>\n<p>In bash (and minimatch), braces with one item are not expanded. To get the same result with braces, set <code>{bash: true}</code>:</p>\n<pre><code class=\"language-js\">braces('a{b}c', {bash: true});\n//=> ['a{b}c']\n</code></pre>\n<h3>options.nodupes</h3>\n<p>Type: <code>Boolean</code></p>\n<p>Deafault: <code>true</code></p>\n<p>Duplicates are removed by default. To keep duplicates, pass <code>{nodupes: false}</code> on the options</p>\n<h2>Bash 4.3 Support</h2>\n<blockquote>\n<p>Better support for Bash 4.3 than minimatch</p>\n</blockquote>\n<p>This project has comprehensive unit tests, including tests coverted from <a href=\"www.gnu.org/software/bash/\">Bash 4.3</a>. Currently only 8 of 102 unit tests fail, and</p>\n<h2>Run benchmarks</h2>\n<p>Install dev dependencies:</p>\n<pre><code class=\"language-bash\">npm i -d &#x26;&#x26; npm benchmark\n</code></pre>\n<h3>Latest results</h3>\n<pre><code class=\"language-bash\">#1: escape.js\n  brace-expansion.js x 114,934 ops/sec ±1.24% (93 runs sampled)\n  braces.js x 342,254 ops/sec ±0.84% (90 runs sampled)\n\n#2: exponent.js\n  brace-expansion.js x 12,359 ops/sec ±0.86% (96 runs sampled)\n  braces.js x 20,389 ops/sec ±0.71% (97 runs sampled)\n\n#3: multiple.js\n  brace-expansion.js x 114,469 ops/sec ±1.44% (94 runs sampled)\n  braces.js x 401,621 ops/sec ±0.87% (91 runs sampled)\n\n#4: nested.js\n  brace-expansion.js x 102,769 ops/sec ±1.55% (92 runs sampled)\n  braces.js x 314,088 ops/sec ±0.71% (98 runs sampled)\n\n#5: normal.js\n  brace-expansion.js x 157,577 ops/sec ±1.65% (91 runs sampled)\n  braces.js x 1,115,950 ops/sec ±0.74% (94 runs sampled)\n\n#6: range.js\n  brace-expansion.js x 138,822 ops/sec ±1.71% (91 runs sampled)\n  braces.js x 1,108,353 ops/sec ±0.85% (94 runs sampled)\n</code></pre>\n<h2>Related projects</h2>\n<p>You might also be interested in these projects:</p>\n<ul>\n<li><a href=\"https://www.npmjs.com/package/expand-range\">expand-range</a>: Fast, bash-like range expansion. Expand a range of numbers or letters, uppercase or lowercase. See… <a href=\"https://www.npmjs.com/package/expand-range\">more</a> | <a href=\"https://github.com/jonschlinkert/expand-range\">homepage</a></li>\n<li><a href=\"https://www.npmjs.com/package/fill-range\">fill-range</a>: Fill in a range of numbers or letters, optionally passing an increment or multiplier to… <a href=\"https://www.npmjs.com/package/fill-range\">more</a> | <a href=\"https://github.com/jonschlinkert/fill-range\">homepage</a></li>\n<li><a href=\"https://www.npmjs.com/package/micromatch\">micromatch</a>: Glob matching for javascript/node.js. A drop-in replacement and faster alternative to minimatch and multimatch. | <a href=\"https://github.com/jonschlinkert/micromatch\">homepage</a></li>\n</ul>\n<h2>Contributing</h2>\n<p>Pull requests and stars are always welcome. For bugs and feature requests, <a href=\"https://github.com/jonschlinkert/braces/issues/new\">please create an issue</a>.</p>\n<h2>Building docs</h2>\n<p>Generate readme and API documentation with <a href=\"https://github.com/verbose/verb\">verb</a>:</p>\n<pre><code class=\"language-sh\">$ npm install verb &#x26;&#x26; npm run docs\n</code></pre>\n<p>Or, if <a href=\"https://github.com/verbose/verb\">verb</a> is installed globally:</p>\n<pre><code class=\"language-sh\">$ verb\n</code></pre>\n<h2>Running tests</h2>\n<p>Install dev dependencies:</p>\n<pre><code class=\"language-sh\">$ npm install -d &#x26;&#x26; npm test\n</code></pre>\n<h2>Author</h2>\n<p><strong>Jon Schlinkert</strong></p>\n<ul>\n<li><a href=\"https://github.com/jonschlinkert\">github/jonschlinkert</a></li>\n<li><a href=\"http://twitter.com/jonschlinkert\">twitter/jonschlinkert</a></li>\n</ul>\n<h2>License</h2>\n<p>Copyright © 2016, <a href=\"https://github.com/jonschlinkert\">Jon Schlinkert</a>.\nReleased under the <a href=\"https://github.com/jonschlinkert/braces/blob/master/LICENSE\">MIT license</a>.</p>\n<hr>\n<p><em>This file was generated by <a href=\"https://github.com/verbose/verb\">verb</a>, v0.9.0, on May 21, 2016.</em></p>",docPath:"argo-ci/node_modules/braces/readme",proj:"argo-ci"}}}});
